Luxembourgish national mobile app to check EU Digital COVID Certificates - The app allows to check in real-time the authenticity and validity of documents issued in the context of the EU Digital COVID Certificate #EUCOVIDCertificate:
• certificate of recovery;
• vaccination certificate;
• test certificate.

The app allows users to:
• scan the QR code on the certificate;
• check the authenticity and the validity of the certificate.

My Pregnancy is a week-by-week pregnancy tracker. Our app will help you over the course of your pregnancy. Stay on top of the changes happening inside your body. Find out how your baby is developing.

Our app is completely free and does not contain advertising.

This app includes:
- week-by-week advice;
- useful information on fetal development and changes in your body;
- week-by-week fetal measurements and imaging;
- a to-do list for each trimester;
- a list of things you will need for hospital check-in, post-natal care and check-out;
- a weight tracker you can use to follow weight gain;
- a kick counter;
- a contraction timer;
- and much more

We have created this app with love, specially for young mothers.

This app is not intended for medical use and is not a substitute for medical consultation.

If you have any questions or requests, please write to neumandev@gmail.com. We are eager to hear your comments on how to improve the app.

Pilule is an app that reminds people to take their medications on time. Suitable for all types of medications: pills, vitamins, injections, etc.

Everything you need in one place: 
— No need to keep track of the time – the app will send you a medication reminder on its own;
— You can customize your courses of treatment. Select the start date and duration of the treatment, as well as the frequency, time, and amount of the doses;
— If medicines need to be taken before or after a meal, please specify such;
— Mark medications as having been taken;
— Track the graph of past and future doses, all the important information is right here;
— Take or skip a dose of medication via notifications.

Easy to use for courses of treatment of any length. Plus, the sleek and straightforward design are user-friendly for everyone.

